import React from 'react';
import './Home.css';
import Member from '../components/Member';

const Home = () => {
  const staticCharacter = {
    thumbnail_url: 'https://your-image-url.com',
    name: 'Character Name',
    class: 'Character Class',
    spec: 'Character Specialization',
    score: 1234,
  };

  return (
    <div className="home">
      <h1>Welcome to Dread+</h1>
      <p>
        This is the home page content. You can add any information, images, or other components you'd like to display here.
      </p>
      <Member character={staticCharacter} />
    </div>
  );
};

export default Home;
